void fft125_4(std::complex<DataType> in[FFT_LENGTH2], std::complex<DataType> out[FFT_LENGTH2])
{

#pragma HLS DATAFLOW
  std::complex<DataType> c0,c1,c2,c3,c4,d0,d1,d2,d3,d4,d5,d6,d7,d8,d9,d10;

  std::complex<DataType> omega1, omega2, omega3, omega4;

  std::complex<DataType> temps[2][FFT_LENGTH2];
#pragma HLS bind_storage variable=temps type=RAM_T2P
  for (int i=0;i<FFT_LENGTH2;i++)
  {
	  temps[0][i]=in[i];
	  temps[1][i].real(0);
	  temps[1][i].imag(0);
  }

  int l= FFT_LENGTH2/5;
  int m=1;

  int curr,next;
  FFT5_4L1:
  for(int t=1;t<=fft5_stages;t++)
  {
	curr = (t-1)%2;
	next = (curr==1)?0:1;
	////printf("curr %d next %d",curr,next);
	FFT5_4L2:
	for(int j=0;j<l;j++)
	{
		FFT5_4L3:
		for(int k=0;k<m;k++)
		{
			//#pragma HLS DATAFLOW
			#pragma HLS PIPELINE II =10
			c0=temps[curr][k+j*m];
			c1=temps[curr][k+j*m + l*m];
			c2=temps[curr][k+j*m + 2*l*m];
			c3=temps[curr][k+j*m + 3*l*m];
			c4=temps[curr][k+j*m + 4*l*m];

			d0=c1+c4;
			d1=c2+c3;
			d2=c1-c4;
			d2=scale_by_real(d2,sin_2pi_5);
			d3=c2-c3;
			d3=scale_by_real(d3,sin_2pi_5);
			d4=d0+d1;
			d5=d0-d1;
			d5=scale_by_real(d5,root5_4);
			d6=scale_by_real(d4,-0.25);
			d6=c0+d6;
			d7=d6+d5;
			d8=d6-d5;

			d9=scale_by_real(d3,sin_pi_5_over_sin_2pi_5);
			d9=d9+d2;
			d9=scale_by_imag(d9,-1);

			d10=scale_by_real(d2,sin_pi_5_over_sin_2pi_5);
		    d10=d10-d3;
		    d10=scale_by_imag(d10,-1);


            /*
		    omega1.real(hls::cosf(-2*pi*j/(5*l)));
		    omega1.imag(hls::sinf(-2*pi*j/(5*l)));
		    omega2.real(hls::cosf(-2*pi*2*j/(5*l)));
		    omega2.imag(hls::sinf(-2*pi*2*j/(5*l)));
		    omega3.real(hls::cosf(-2*pi*3*j/(5*l)));
		    omega3.imag(hls::sinf(-2*pi*3*j/(5*l)));
		    omega4.real(hls::cosf(-2*pi*4*j/(5*l)));
		    omega4.imag(hls::sinf(-2*pi*4*j/(5*l)));
			*/

		    int loc1 = 1*j*(125/(5*l));
			int loc2 = 2*j*(125/(5*l));
			int loc3 = 3*j*(125/(5*l));
			int loc4 = 4*j*(125/(5*l));

			omega1.real(cosines_125[loc1]);
			omega1.imag(sines_125[loc1]);
			omega2.real(cosines_125[loc2]);
			omega2.imag(sines_125[loc2]);
			omega3.real(cosines_125[loc3]);
			omega3.imag(sines_125[loc3]);
			omega4.real(cosines_125[loc4]);
			omega4.imag(sines_125[loc4]);


		    temps[next][k + 5*j*m] = c0+d4;
		    temps[next][k + 5*j*m + m] = omega1*(d7 + d9);
		    temps[next][k + 5*j*m + 2*m] = omega2*(d8 + d10);
		    temps[next][k + 5*j*m + 3*m] = omega3*(d8 - d10);
		    temps[next][k + 5*j*m + 4*m]= omega4*(d7 - d9);

		}
	}
	l=l/5;
	m=m*5;
  }

  for(int kk=0;kk<FFT_LENGTH2;kk++)
  {
  	  out[kk]=temps[next][kk];
  }
  /*
  for(int kk=0;kk<FFT_LENGTH2;kk++)
  {
	  //printf("%f\n ",temps[next][kk].imag());
  }
  //printf("\n");
  */


}


